import React from 'react';
import ReactDOM from 'react-dom';
import "./css/productStyle.css";

class Products extends React.Component{
  constructor(){
    super();
    this.state = {
      products:[]
    }
  }
  componentDidMount()
  {
   fetch('https://www.json-generator.com/api/json/get/bTBLpQKoSW?indent=2')
   .then(res => res.json())
   .then((data) => {
     console.log(data)
     this.setState({products: data })
   })
   .catch(console.log)
 }
  render(){
    const list = this.state.products.map((element) => <tr><td>{element.name}</td>   <td>{element.price}</td></tr>);
    return( <div className='container'>
                <table id ='tableId' align='center'>
                   <tr>
                     <td colspan="2"><h1>Prdocuts</h1></td>
                   </tr>
                   <tr>
                     <th>Product</th>
                     <th>Price</th>
                   </tr>
                   {list}
                </table>
           </div>)
  }
}
export default Products;
